INSERT INTO `quote` (`id`, `quote`, `quotephrase`) VALUES
(1, 'As Visual Artists, we produce sculptures, paintings, videos, drawings and other types of artwork. We make use of the input provided by clients to create visually appealing pieces. In summary we provide all Visual art services in', 'Visual Artists in '),
(2, 'As bag makers, we are into bag making in Nigeria. We make all kinds of bags like Hand bags, Duffle bags, Satchel,   pouch, School bags and many more. We make use of the input provided by clients to create bags that suit their needs. In summary we make all kinds of bags in', 'Bag makers in '),
(3, 'As bakers, we produce all kinds of cakes like Yellow butter cake, Pound cake, Red velvet cake, Sponge cake and many more. We also produce pastries and breads. We bake for all occasions and follow the instructions given to us by our Clients. We offer all baking services in ', 'Bakers in'),
(4, 'As bead makers we make glass beads and decorative jewellery findings, such as petals and leaves. We make beads in Nigeria that go with any dress you put on. Our work relies on the input provided by our clients so it is okay to say we provide all types of bead making services in ', 'Bead Makers in '),
(5, 'As carpenters we build and repair wooden objects used for buildings and other structures. We consult with clients, take measurements, choose the appropriate work materials, build and install doors and windows. Contact us for a Carpenter in ', 'Carpentry Services in'),
(6, 'As Tilers, we lay tiles on floors and walls. We help beautify Sections in the home like bathrooms and kitchens. We fix tiles in offices and outdoor environments like swimming pools. In summary we provide all tiling services in ', 'Contact us for a tiler in '),
(7, 'As gardeners, we improve and maintain the beauty of landscaped environments by installing landscapes and maintaining the appearance of existing grounds. Our services include creating a sustainable and pleasing environment around buildings by cutting, trimming, edging walls and flower beds. We provide all gardening services in ', 'Gardening in '),
(8, 'As graphics designers, we help in the development of magazines, books, websites, product packaging and many other things by producing original designs. We work with the inputs given to us by our clients and also help by presenting our own design ideas so as to achieve a desirable goal. Contact us to provide all graphic design services in', 'Graphic designers in'),
(9, 'As hair dressers and stylists, we do tasks such as cutting and styling of hair, blow-drying, applying hair dye and treatments. We listen to the requirements of our clients attentively in order to make them happy and satisfied. We are prepared to meet our clients wherever they are located. Contact us for all Hair dressing and styling services in', 'Hair Stylist and dresser in '),
(10, 'As interior decorators, we create beautiful, comfortable and safe interior spaces by using a variety of elements, from paint colour to lighting. We give various design ideas to our clients for them to pick from. We are very attentive when listening to the requirements of our clients. Contact us for top notch interior decoration services in ', 'Interior decorators in'),
(11, 'As makeup Artists, We help our clients touch up their look. We listen attentively to our clients requirements, sketch up make up ideas, applying make up, keeping them updated about make up products and techniques and most importantly adhering to health and safety regulations. Message us for make up services for all events in ', 'Make up Artists in '),
(12, 'As nail technicians, we fix and remove nail polish, clean, trim and file nails. Reduce rough skin and calluses, massage and moisturize the hands and feet. We also counsel clients about nails and skincare for hands and feet. Contact us for high quality manicure and pedicure services in', 'Manicure and Pedicure in '),
(13, 'We provide high quality and very affordable clothing materials and accessories that suits the style of every tribe in Nigeria.  We listen attentively to the requirements of our clients and provide them with the desired material for every occasion. All round delivery in', 'High quality and affordable materials in'),
(14, 'As Mobile application developers, We create softwares for mobile devices using various programming languages. We consult with our clients, design and test the application created. We are very time efficient and detail oriented when providing mobile app development services in ', 'Mobile app developers in '),
(15, 'As photographers, we cover events like weddings, graduations, birthdays and many more. We create visual images using photography equipments. We organize photo shoots, design and edit the photo background and deliver finished products. In summary we cover all events requiring photography in', 'Photographers in '),
(16, 'As Real Estate Agents, we help clients sell or Lease properties. We help in assessing the properties condition, taking pictures and advertising the properties. We also offer good counselling to clients and buyers.  Below are Real estate agents in ', 'Real Estate in'),
(17, 'As Shoemakers, we make, design and repair all kinds of foot wear e.g. sandals, shoes and palm slippers. We fit and design footwears to the perfection of our clients requirements. Contact us to get top notch shoe making services in', 'Shoemakers in'),
(18, ' As Tailors, we are responsible for constructing, altering and modifying garments for customers based on their specifications, needs and preferences. We take customers measurements, assist in fabric selection and arrange fittings to determine whether additional adjustments are needed. We sew clothes for all kinds of occasions based on the needs of our clients. Since variety is the spice of life, spice of yours with Top notch Tailoring services in ', 'Tailors in Nigeria'),
(19, 'As video Editors, We use our various computer software to assemble recorded raw materials into a finished product that is suitable for broadcasting. We also offer clients our creative minds and are very time efficient. Get video editing services in', 'Video editor in'),
(20, 'As web developers, we design and update websites and online applications for our clients using various programming languages and design tools. We develop all kinds of blogs, ecommerce websites or a simple landing page. We are very time efficient and work hand in hand with our clients to achieve a desirable goal. Get web development services in', 'web developers in'),
(21, 'As wedding planners, we provide assistance to both the bride and groom with the organization of a wedding. We talk about requirements and budgets, advice on wedding costumes, secure the services of a caterer and photographer with minimizing costs on our mind. We coordinate the whole wedding event. Contact us and get a very good wedding planning services in', 'wedding planners in'),
(22, 'As fashion designers, we create garments and accessories for clients. We also create new ideas, draw sketches and research new fashion trends in order to make our clients happy. Get fashion designing services in', 'Fashion designers in'),
(23, 'We Prepare food for major events like weddings, birthdays and many more. We also cook all kinds of dishes for homes. We help in planning the menus for events and most importantly we follow food hygiene standards. Contact us for food services in any occasion, right here in ', 'food services in'),
(24, 'We make skin care products which contain organically grown ingredients that are free from pesticides and alterations. Our products are very beneficial to the skin because they contain little to no harsh chemical ingredients which could be harmful to the skin in the long run. Get Skin care Products in', 'Organic Skincare Products in'),
(25, 'As Data and Airtime service providers, we buy telecommunications network mobile data in bulk for later reselling to clients. We are available 24 hours and make buying of data and Airtime more convenient for our clients. Contact an Airtime service provider in', 'Data and Airtime services in '),
(26, 'As Barbers, we provide barbering services to our clients and render services like shampooing, trimming hair and beards, giving shaves, styling hair and massaging face, scalp and neck. We also help in sanitizing our clients barbing equipments. We are very organized and listen to our clients instructions attentively. Contact a Barber in', 'Barbing services in'),
(27, 'As Soap makers, we are responsible for producing all kinds of soap e.g Laundry soap and Toilet soap which are huge necessities in all homes and companies. Our bathing soap are also very useful and beneficial to the skin. While doing this we are careful of the ingredients we use in order not to cause any harm to our clients. Get Soap making services in ', 'Soap makers in '),
(28, 'We install Aluminium windows and doors to buildings. We are very time efficient and have good communication skills with our clients. Contact us for your Aluminium windows and doors installation in ', 'Aluminium windows and doors installers in'),
(29, 'We advise about, design, install and maintain cost-effective and energy efficient systems for buildings such as water, lighting, heating, air conditioning, lifts and telecoms. We are responsible for converting your building into a comfortable living space. We have strong communication skills and listen attentively to the requirements and needs of our clients in ', 'Building services in'),
(30, 'We are responsible for providing our customers with the best fragrances e.g. perfume oils at a very affordable price. We supply customers based on their needs and requirements. Get very good Fragrances e.g. perfume oils in ', 'Fragrance providers in'),
(31, 'As Writers, poets and lyricists, we interpret and represent a clients creative needs into written prose. We are responsible for writing songs, newspaper articles, advertising jingles and verses for greeting cards. We help make sense of our clients creative minds by putting it to writing. We are also available to perform at events. Contact a writer, Poet or Lyricist in', 'Poetry, writing and lyrics services in '),
(32, 'As digital Marketers, we are responsible for planning and managing companies and individuals marketing campaigns to promote their brand product and services. Part of our Jobs involve planning campaigns, analysing metrics and identifying trends. We are highly experienced in the use of Social media. If you are an individual, a small firm or a major company trying to conquer the online world get Digital marketing services in', 'Digital Marketers in'),
(33, 'As Music Producers we mix sounds by drawing instrumental and vocal elements together. We produce albums for clients, mix and master music for our clients and provide music stations with equipments. Get very good Music production services in', 'Music Producers in'),
(34, 'Our Sole purpose is to help registered members of nocv.ng get their products to their customers (end users) on time. We also help other clients deliver any type of legal goods to their customers (end users). We are also available for pickup services. Get fast and efficient Delivery services in', 'Delivery services members in'),
(35, 'As Land Surveyors, we measure properties, locate buildings, roads and utilities for real estate developers, or measure the exact limits of mining claims, and mark their locations on the maps collectively. Contact us for Land surveying services in', 'Land Surveyors in'),
(36, 'As Disc jockeys(Dj),we broadcast music in clubs, at events, or over radio stations. We create playlists provide music at various events like birthdays and weddings, mix music tracks and collaborate with musicians. We have a strong passion for music and are up to date on the musical trends. Contact us for Dj services in', 'Disc jockeys(Dj) in'),
(37, 'As Craftsmen we create functional or decorative objects by hand, using a variety of methods and materials for our clients use in homes, companies and other places in need of a unique look. Contact us to get a wonderful craft work in', 'Craft in'),
(38, 'As Artists, we entertain people through music, dance, stage entertainment and theatre. We express our talents through recordings or in front of live audiences. We are available to work flexible hours so contact us if you are in need of actors, dance choreographers and comedians in', 'Performing Arts in '),
(39, 'As Henna designers, we use a liquid plant based substance to provide beautiful henna designs on the hands, feet or any other part of the body. We offer our services to many events like weddings and parties as well as personal uses. We have good communication skills and listen attentively to clients requirement in order to achieve our goal. Contact us to get Henna Services in ', 'Henna Design in '),
(40, 'We apply paint, varnish, wallpaper and other finishes and special coatings to the walls, ceilings and other surfaces of residential, commercial and industrial buildings and structures. Contact us for interior / exterior painting services in', 'Interior / Exterior Painting designers in'),
(41, 'As a Lighting Designer, we install lighting and electrical systems for residential, commercial and industrial spaces in ', 'Lighting Designers in'),
(42, 'We make homes and industries clean and sparkle by scrubbing and cleaning of tiles, vacuum of rug, cleaning handrails, dust free ceilings, cobwebs, furnitures and fitting, Light switches, windows, doors, removing of stubborn stain from tiles, kitchen, toilet and bathroom. We clean your Industrial buildings, industrial environment, machinery and Offices. Get Top notch home and industrial cleaning services in', 'Home and industrial cleaning in');
